query:
INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, '14070', 'Stroke Treatment - Adult', 'Treatment Protocols', 'Patient exhibiting signs/symptoms of stroke including speech disturbances, altered LOC, paresthesias, new onset seizures, dizziness, unilateral weakness, visual disturbances. Perform mLAPSS screening. Obtain blood glucose. Transport to stroke center.', 'https://icema.sbcounty.gov/wp-content/uploads/sites/100/11.01.25-Policy-Manual.pdf', NOW()
FROM counties c WHERE c.name = 'Inland Counties EMS Agency' AND c.state = 'California' LIMIT 1;

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, '14020', 'Cardiac Arrest - Pediatric', 'Treatment Protocols', 'Begin CPR with 15:2 ratio. Attach monitor. VF/VT: Defibrillate 2J/kg. Resume CPR. IO access if IV not obtained in 90 seconds. Epinephrine 0.01mg/kg IV/IO every 3-5 minutes.', 'https://icema.sbcounty.gov/wp-content/uploads/sites/100/11.01.25-Policy-Manual.pdf', NOW()
FROM counties c WHERE c.name = 'Inland Counties EMS Agency' AND c.state = 'California' LIMIT 1;

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, '14030', 'Chest Pain - Cardiac', 'Treatment Protocols', 'Obtain 12-lead ECG. Aspirin 324mg PO if no contraindications. Nitroglycerin 0.4mg SL if SBP greater than 90. Morphine 2-4mg IV for pain if NTG ineffective. Consider STEMI activation if ST elevation.', 'https://icema.sbcounty.gov/wp-content/uploads/sites/100/11.01.25-Policy-Manual.pdf', NOW()
FROM counties c WHERE c.name = 'Inland Counties EMS Agency' AND c.state = 'California' LIMIT 1;

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, '14040', 'Respiratory Distress - Adult', 'Treatment Protocols', 'Assess airway, breathing, circulation. Oxygen therapy to maintain SpO2 94-98%. Albuterol 2.5mg nebulized for bronchospasm. CPAP for pulmonary edema. Consider advanced airway if needed.', 'https://icema.sbcounty.gov/wp-content/uploads/sites/100/11.01.25-Policy-Manual.pdf', NOW()
FROM counties c WHERE c.name = 'Inland Counties EMS Agency' AND c.state = 'California' LIMIT 1;

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, '14050', 'Allergic Reaction/Anaphylaxis', 'Treatment Protocols', 'Epinephrine 0.3mg IM for anaphylaxis. Diphenhydramine 25-50mg IV/IM. Albuterol for bronchospasm. IV fluid bolus for hypotension. Repeat epinephrine every 5-15 minutes if needed.', 'https://icema.sbcounty.gov/wp-content/uploads/sites/100/11.01.25-Policy-Manual.pdf', NOW()
FROM counties c WHERE c.name = 'Inland Counties EMS Agency' AND c.state = 'California' LIMIT 1;

